              />
            </div>
          </div>
          <div className="grid-item">
            <img src="" width="200" height="200" />
            <div className="re">
              <input
                type="file"
                id="image"
                accept="img/*"
                onChange={onLoadFile}
              />
            </div>
          </div>

          <div className="grid-item">
            <img src="" width="200" height="200" />
            <div className="re">
              <input
                type="file"
                id="image"
                accept="img/*"
                onChange={onLoadFile}
              />
            </div>
          </div>
          <div className="grid-item">
            <img src="" width="200" height="200" />
            <div className="re">
              <input
                type="file"
                id="image"
                accept="img/*"
                onChange={onLoadFile}
              />
            </div>
          </div>
          <div className="grid-item">
            <img src="" width="200" height="200" />
            <div className="re">
              <input
                type="file"
                id="image"
                accept="img/*"
                onChange={onLoadFile}
              />
            </div>
          </div>
          <div className="grid-item">
            <img src="" width="200" height="200" />
            <div className="re">
              <input
                type="file"
                id="image"
                accept="img/*"
                onChange={onLoadFile}
              />
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export { onesculp, twosculp, threesculp, foursculp };

export default Sculpture;
